"This jab is the game-changer."

@SadiqKhan tells #KayBurley he is "working closely" with the government to make more Pfizer and Moderna vaccines available to London's younger population to help combat the spread of the Delta variant.

#COVID19 latest: https://t.co/OZd6l9PrkC https://t.co/r3N6vbutJy

An Israel study shows two doses of Pfizer's #COVID19 vaccine can provide more than 95% protection against infection.

@WHO's Margaret Harris says the data helps give an understanding of "what the vaccine is doing and how we can use it most effectively."

https://t.co/NnLPZY7HAY https://t.co/w0i3tTO6em

A single shot of the Oxford-AstraZeneca or Pfizer-BioNTech jab is more than 80% effective at preventing hospitalisation among the over 80s.

@ashishskynews takes a closer look at the new vaccine data.

Get more on the #COVID19 figures here: https://t.co/DNkQNmBkXE https://t.co/aPdNCSEoTG

England is ramping up its vaccine rollout with the opening of 32 new vaccination centres - but with both Pfizer and AstraZeneca facing production delays, will the UK hit its target of offering 15m jabs by mid-February?

@RowlsManthorpe reports.

#COVID19: https://t.co/aDH3S4vQex https://t.co/a9dn3PmF61

The first people to receive a Pfizer/BioNTech vaccine in Newcastle say they are 'really excited' and 'looking forward' to their jab.

@kvittozzi says it is a 'hugely symbolic day' for the city, which is in Tier 3 restrictions.

